import React from 'react';


import "./css/app.css";
import PathFindApp from './react/pages/pathfind-page';
import InstructionsPage from './react/pages/instructions-what-is-an-algorithm-page';
import  {BrowserRouter,Router,Switch, Route} from 'react-dom'



function App() {
  return (
    <Router>
    <div className="app">
    <InstructionsPage></InstructionsPage>
    <Route path="/App">
    <PathFindApp></PathFindApp>
    </Route>
    </div>
    </Router>
  );
}

export default App;
